          const cohortInput = PolymerUtils_PolymerUtils.getElementById(this._prefix + studyId + cohort.id + "Cohort");
          let operator = PolymerUtils_PolymerUtils.getElementById(this._prefix + studyId + cohort.id + "CohortOperator");

