    //$("#" + this._prefix + "DiseasePanels").selectpicker("val", []);
    //handled in updated() in biotype-filter
    //$("#" + this._prefix + "GeneBiotypes").selectpicker("val", []);


    $("#" + this._prefix + "vcfFilterSelect").selectpicker("val", []);
